import React from 'react';
import {Message} from 'Domain/Message';


function MessageView({message, name, id = '', timestamp = 4711}: Message): JSX.Element {
    return (
        <>
            {id}
            <article>{message}</article>
            <footer>{name}</footer>
        </>
    )
}

export default MessageView;
